;; gorilla-repl.fileformat = 1

;; **
;;; # Розподіл депутатів Верховної Ради України за результатами голосувань
;;; 
;;; 
;; **

;; **
;;; Наразі маємо 8 фракцій у Верховній Раді України (ВРУ). Визначення принадлежності депутата до фракції визначається його особистим уподобанням (мажоритарщики) та партією що висунула.
;;; 
;;; А якби розподілити депутатів по фракціях згідно результатів їх голосувань? Так щоб їх розбити згідно зі статистикою голосувань протягом созиву?
;;; 
;;; 
;;; Загальний підхід наступний:
;;; 1. зібрати дані(вичитати відомості про склад ВРУ, вичитати дані про голосування)
;;; 2. перетворити їх на табличний, числовий вид
;;; 3. розбити на вибірки-кластери, так щоб в кожному  складався з схожих об'єктів, а об'єкти різних кластерів істотно відрізнялися. В математиці ця задача називається [кластерним аналізом](https://uk.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D1%81%D1%82%D0%B5%D1%80%D0%BD%D0%B8%D0%B9_%D0%B0%D0%BD%D0%B0%D0%BB%D1%96%D0%B7)
;; **

;; **
;;; Для початку слід вичитати та розпізнати дані про голосування зі сайту ВРУ, загальні відомості візьмемо з [вікіпедії](https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%B0_%D0%A0%D0%B0%D0%B4%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_VIII_%D1%81%D0%BA%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD%D0%BD%D1%8F):
;; **

;; @@
(постійна депутати-по-фракціях-ВР 
          (хай  [
                  документ  (get! "https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%B0_%D0%A0%D0%B0%D0%B4%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_VIII_%D1%81%D0%BA%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD%D0%BD%D1%8F")
                  таблиця  (-> (.select документ  "table")   (.отримай 3) (.select "tr"))                 
                  номера-депутатів (проміжок 1 (.size таблиця) )
                  ]
                (->> номера-депутатів 
                     (відобрази 
                       #(хай[рядок (-> таблиця (.отримай %) (.select "td"))]    
                            {:суб'єкт-висування (-> рядок (.отримай 1) .text) 
                             :фіо (хай [повне (-> рядок (.отримай 2) .text)
                                        прізвище  (-> повне (.split " ") перший)
                                        імя (-> повне (.split " ") другий)
                                        по-батькові (-> повне (.split " ") останній)              
                                        ]
                                       (str прізвище " " (-> імя (.charAt 0)) "." (-> по-батькові (.charAt 0)) "."))
                             :номер-у-списку (-> рядок (.отримай 3) .text)
                             :округ (-> рядок (.отримай 4) .text)
                             :фракція (-> рядок (.отримай 5) .text)
                             })
                       )
                     )
                )
)
(друкуй "зчитано дані з вікіпедіі дані про " (розмір депутати-по-фракціях-ВР ) "  депутатів")
;; @@
;; ->
;;; зчитано дані з вікіпедіі дані про  423   депутатів
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(постійна фракції-ВР (дай-різні (відобрази :фракція розподіл-фракцій)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/фракції-ВР-10012018_1</span>","value":"#'user/фракції-ВР-10012018_1"}
;; <=

;; **
;;; Нажаль стайт ВРУ надає ФІО з ініціалами, нац. гвардієць Тимошенко Юрій Володимирович та Тимошенко Юлія Володимірівна мають однакові ініціали, тому приберемо їх для певності.
;; **

;; @@
(постійна прізвища-депутатів-без-Тимошенко (фільтруй #(не (= % "Тимошенко Ю.В.")) (дай-різні (відобрази :фіо депутати-по-фракціях-ВР))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/прізвища-депутатів-без-Тимошенко-10012018</span>","value":"#'user/прізвища-депутатів-без-Тимошенко-10012018"}
;; <=

;; **
;;; Тепер зчитаємо результати голосувань, на разі маємо менше за 8000 голосувань
;; **

;; @@
(постійна голосування (застосуй з'єднай (->> (проміжок 0 50000) (відобрази #(прочти-документ % депутати-по-фракціях-ВР)) (фільтруй #(-> % пусто? не)))))
(друкуй "зчитано " (розмір голосування) " персональних голосувань " (розмір прізвища-депутатів) " депутатів");; займає до години в залежності від швидкості
;; @@
;; ->
;;; зчитано  2228787  персональних голосувань  422  депутатів
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; У якості математичного апарату можна застосувати [кластеризацію](https://uk.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D1%81%D1%82%D0%B5%D1%80%D0%B8%D0%B7%D0%B0%D1%86%D1%96%D1%8F_%D0%BC%D0%B5%D1%82%D0%BE%D0%B4%D0%BE%D0%BC_%D0%BA%E2%80%93%D1%81%D0%B5%D1%80%D0%B5%D0%B4%D0%BD%D1%96%D1%85) методом [к–середніх](https://uk.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D1%81%D1%82%D0%B5%D1%80%D0%B8%D0%B7%D0%B0%D1%86%D1%96%D1%8F_%D0%BC%D0%B5%D1%82%D0%BE%D0%B4%D0%BE%D0%BC_%D0%BA%E2%80%93%D1%81%D0%B5%D1%80%D0%B5%D0%B4%D0%BD%D1%96%D1%85):
;;; 
;; **

;; @@
(функція депутати-по-кластерах [результати-голосувань прізвища кількість-кластерів ]
 (хай [фракції (smile.clustering.KMeans. (результати-на-масив результати-голосувань прізвища) кількість-кластерів)] ; займає до 10 хвилин, створення кластерів
      (відобрази #(геш-таблиця  
                    :фіо % 
                    :фракція-за-результатами-голосувань (.predict фракції (перший (результати-на-масив результати-голосувань [%]))))
                 прізвища)     
)) ; функція займає до 10 хв, розподіл на кластери
;; @@

;; **
;;; І нарешті, можемо розподілити депутатів на кластери згідно з голосуваннями.
;;; Спочатку розподіли на дві групи
;; **

;; @@
(покажи-розподіл-фракцій-по-кластерах 2 "розподіл на дві групи, \n Номер групи:" (депутати-по-кластерах голосування прізвища-депутатів-без-Тимошенко 2))
